    public function getContracts(Request $request)
    {
        set_time_limit(-1);
        ini_set('memory_limit', -1);
        $type = $request->get("type");
        $query = "select c.* from contracts c inner join tuition_fee fee on c.tuition_fee_id = fee.id and fee.session >0 where c.class_id is null and c.real_sessions >0 and c.status != 7";
        $contracts = u::query($query);

        $contractAll = u::query("select c.* from contracts c inner join tuition_fee t on c.tuition_fee_id = t.id where t.session > 0 and c.class_id is not null");
        $contractClassMap = u::convertArrayToObject($contractAll, function ($contract) {
            return $contract->accounting_id;
        }, true);

        $withdrawContracts = [];
        $preWithdrawContracts = [];
        $contractEmpty = [];
        $now = date("Y-m-d");
        $p = u::getPublicHolidays(0, 0, 0);
        $cc = [];
        foreach (contract_dates as $key => $value) {
            $cc[trim($key)] = trim($value);
        }
        foreach ($contracts as $index => $contract) {
            $date = isset($cc[$contract->accounting_id]) ? $cc[$contract->accounting_id] : null;
            if ($date) {
                $list = isset($contractClassMap[$contract->accounting_id]) ? $contractClassMap[$contract->accounting_id] : null;
                $realSessions = 0;
                if (!empty($list)) {
                    foreach ($list as $item) {
                        $realSessions += (int)$item->real_sessions;
                    }
                }
                $realSessions += $contract->real_sessions;
                $real = u::getRealSessions($realSessions, [0], $p, $date);
                $realCal = u::getRealSessions($realSessions + 1, [0], $p, $date);
                $end_date = $real->end_date;
                $cal_end_date = $realCal->end_date;
                if ($cal_end_date < $now) {
                    $withdrawContracts[] = ['id' => $contract->id, "contract" => $contract->accounting_id, "end_date" => $end_date, "cal_end_date" => $cal_end_date];
                } else {
                    $preWithdrawContracts = ['id' => $contract->id, "contract" => $contract->accounting_id, "end_date" => $end_date, "cal_end_date" => $cal_end_date];
                }
            } else {
                $contractEmpty[] = $contract->accounting_id;
            }
        }

        $contractWidthdaw = u::query("select accounting_id from contracts where status = 7");
        if ($type == 1) {
            $accoutingIds = array_values(array_column($withdrawContracts, "id"));
            $strContracts = implode("','", $accoutingIds);
            $update = "
              UPDATE contracts SET status=7 WHERE id in ( '$strContracts' )
            ";
            u::query($update);
        }

        $res = new Response();
        return $res->formatResponse(APICode::SUCCESS, [
            'hợp đồng có thể đổi trạng thái về 7' => $withdrawContracts,
            "hợp đồng cần confirm để đổi trạng thái về 7" => $preWithdrawContracts,
            "hợp đồng không có trong phiếu nhập học của cyber" => $contractEmpty,
            "hợp đồng đã về 7" => $contractWidthdaw
        ]);
    }

